  false,\n\t\"url\": null,\n\t\"notes\": \"This report discusses the evaluation of
  techniques for assessing neonatal caribou calf mortality in the Porcupine caribou
  herd in Arctic National Wildlife Refuge. Caribou use ANWR for calving, post-calving
  aggregations, and insect relief activities during the spring and summer. The objectives
  of this study are to determine feasibility of using mortality sensing radio-transmitters
  to detect and determine causes of mortality in neonatal caribou calves, identify
  temporal and spatial patterns of caribou calves, and determine post-calving movements.\",\n\t\"license_title\":
